import './../App.css';

class Square extends Component {
    constructor(props){
        super(props)
        this.state = {
            value: this.props.value
        }
    }

    changeValue(){
        this.setState({
            value: "X"
        });
    }

    changeValueMain(){
        console.log("Main")
    }

    render() {
    return (
        <div className= {"Square" + this.props.size} key = {this.props.key} onClick = {this.props.func}>
            {this.state.value}
        </div>
    );
  }
}

export default Square;
